class ByteBuffer:
    def __init__(self, raw):
        self.ptr = 0
        self.raw = raw
    
    def take(self, byte_cnt):
        ret = self.raw[self.ptr:self.ptr + byte_cnt]
        self.ptr += byte_cnt
        return ret
    
    def left_bytes(self):
        return len(self.raw) - self.ptr

bb = ByteBuffer(my_tile_entity_data)

numentities = struct.unpack('<i', bb.take(4))[0] #int32
entities = []

for _ in range(numentities):
    entype = struct.unpack('<B', bb.take(1))[0] #uint8
    enid = struct.unpack('<i', bb.take(4))[0] #int32
    posX = struct.unpack('<h', bb.take(2))[0] #int16
    posY = struct.unpack('<h', bb.take(2))[0] #int16
    curr_en = TileEntity(type=entype, entity_id=enid, posX=posX, posY=posY)

    if entype == TileEntityType.TrainingDummy:
        curr_en.attribute["npc"] = struct.unpack('<h', bb.take(2))[0] #int16
    elif entype in [TileEntityType.ItemFrame,
                    TileEntityType.WeaponRack,
                    TileEntityType.FoodPlatter]:
        netid = struct.unpack('<h', bb.take(2))[0] #int16
        prefix = struct.unpack('<B', bb.take(1))[0] #uint8
        stacksize = struct.unpack('<h', bb.take(2))[0] #int16
        curr_en.attribute["item"] = Item(stacksize=stacksize,
                                         netid=netid,
                                         prefix=prefix)
    elif entype == TileEntityType.LogicSensor:
        curr_en.attribute["logiccheck"] = struct.unpack('<B', bb.take(1))[0] #uint8
        curr_en.attribute["on"] = (bb.take(1) != b'\x00') #boolean
    elif entype == TileEntityType.DisplayDoll:
        item_bitmask = struct.unpack('<B', bb.take(1))[0] #uint8
        dye_bitmask = struct.unpack('<B', bb.take(1))[0] #uint8
        items:list[Item] = [Item() for _ in range(8)]
        dyes:list[Item] = [Item() for _ in range(8)]
        for idx in range(8):
            if item_bitmask & (1 << idx):
                netid = struct.unpack('<h', bb.take(2))[0] #int16
                prefix = struct.unpack('<B', bb.take(1))[0] #uint8
                stacksize = struct.unpack('<h', bb.take(2))[0] #int16
                items[idx] = Item(stacksize=stacksize,
                                  netid=netid,
                                  prefix=prefix)
        for idx in range(8):
            if dye_bitmask & (1 << idx):
                netid = struct.unpack('<h', bb.take(2))[0] #int16
                prefix = struct.unpack('<B', bb.take(1))[0] #uint8
                stacksize = struct.unpack('<h', bb.take(2))[0] #int16
                dyes[idx] = Item(stacksize=stacksize,
                                 netid=netid,
                                 prefix=prefix) 
        curr_en.attribute["items"] = items
        curr_en.attribute["dyes"] = dyes
    elif entype == TileEntityType.HatRack:
        slots_bitmask = struct.unpack('<B', bb.take(1))[0] #uint8
        items:list[Item] = [Item() for _ in range(8)]
        dyes:list[Item] = [Item() for _ in range(8)]
        for idx in range(2):
            if slots_bitmask & (1 << idx):
                netid = struct.unpack('<h', bb.take(2))[0] #int16
                prefix = struct.unpack('<B', bb.take(1))[0] #uint8
                stacksize = struct.unpack('<h', bb.take(2))[0] #int16
                items[idx] = Item(stacksize=stacksize,
                                  netid=netid,
                                  prefix=prefix) 
        for idx in range(2):
            if slots_bitmask & (1 << (idx + 2)):
                netid = struct.unpack('<h', bb.take(2))[0] #int16
                prefix = struct.unpack('<B', bb.take(1))[0] #uint8
                stacksize = struct.unpack('<h', bb.take(2))[0] #int16
                dyes[idx] = Item(stacksize=stacksize,
                                 netid=netid,
                                 prefix=prefix) 
        curr_en.attribute["items"] = items
        curr_en.attribute["dyes"] = dyes

    entities.append(curr_en)

print(entities)
print(f"left byte: {bb.left_bytes()}")